import React from 'react';
class Count extends React.Component{ 
    constructor(){
        super()
        this.state={count:0}
    }
    
    inc(){
        this.setState(prev=>({count:prev.count+1}))
    }
    inc5(){
        this.inc()
        this.inc()
        this.inc()
        this.inc()
        this.inc()
    }
    render(){
        return(
            <div>
                <h1>count-{this.state.count}</h1>
                <button onClick={()=>this.inc5()}>Increment5</button>
            </div>
        )
    }
}
          
export default Count;
